import React from 'react';
import ReactDOM from 'react-dom';


const App = () => {
  console.log("Nget wget")
  const now = new Date()
  const a = 10
  const b = 20
  return(
    <div>

    <p>Hello world, {now.toString()}</p>
    <p> {a} + {b} = {a+b}</p>
  </div>)
}

ReactDOM.render(<App />, document.getElementById('root'))
